    $('input[id*="txt"], textarea').each(function () {

        this.value = $(this).attr('title');

        $(this).focus(function () {
            if (this.value == $(this).attr('title')) {
                this.value = '';
            }
        });

        $(this).blur(function () {
            if (this.value == '') {
                this.value = $(this).attr('title');
            }
        });
    });

    function sanitizeInput() {
        $('input[id*="txt"], textarea').each(function () {

            if (this.value == $(this).attr('title')) {
                this.value = '';
            }
        });

        return true;
    }
